import Navbar from "../Components/Navbar/index";


function myFunction() {
   return (
     <div>
       <Header />
       <Navbar />
       <p>Lorliales tur risus tellus, gravida rhoncus mi dictum quis. Donec at tempor orci, non egestas ligula. Praesent nec mi accumsan, ultricies nunc nec, molestie urna. Cras consectetur sapien ac ante ultrices, nec volutpat sapien ornare. In hac habitasse platea dictumst. Phasellus ullamcorper nibh sed porttitor suscipit. Aliquam bibendum tellus sed tempus semper. Vestibulum dignissim a est eu condimentum. Suspendisse cursus ligula eu malesuada sodales.</p>
     </div>
   );
 }

 export default myFunction;
